console.log(fun("23"));
`.trim();

const parenthesis = `
function fun(s) {
  const stack = [];
  const brackets = {
    '(': ')',
    '{': '}',
    '[': ']',
  };

  for (let i = 0; i < s.length; i++) {
    const char = s[i];
    if (brackets[char]) {
      stack.push(char);
    } 
    else {
